INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (1, 1, "春咲 ひより", "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 0, 0, 0, 1, 0, 1.4, 2, "ねぇねぇ、騎士クン\n手伝ってあげようよ～", "お！\nあそこに困ってそうな人発見！", 1001, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (1, 1, "草野 優衣", "みんなみたいに\nわたしも強くならなきゃ", 0, 0, 0, 1, 0, 1.4, 2, "わ、わたし、\nなに言ってるんだろ\nあはは…", "大切な人を\n守れるようになりたい…って", 1002, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (1, 1, "士条 怜", "フェンシングを始めてみては？", 0, 0, 0, 1, 0, 1.4, 2, "少しは磨かれると思いますよ。", "キミに必要な集中力と感性が", 1003, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (1, 1, "穂高 みそぎ", "ねぇ、にいちゃん！", 0, 0, 0, 1, 0, 1.5, 2, "みそぎはねぇ、\nかくれんぼやりたい！", "今日はなにして遊ぶ？", 1004, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (1, 1, "風宮 あかり", "風宮あかりです", 0, 0, 0, 1, 0, 1.4, 2, "私といっしょに…\nいかない？", "ねぇ…", 1006, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (1, 1, "出雲 宮子", "出雲宮子なのー", 0, 0, 0, 1, 0, 1.5, 2, "食べ物の恨みは怖いのー", "プリンたべたいのー", 1007, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (1, 1, "虹村 雪", "ボクは虹村雪。", 0, 0, 0, 1, 0, 1.4, 2, "いいよ。\n見られることは運命さ…", "キミもボクの美貌に\n吸い寄せられたんだね。", 1008, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (1, 1, "柊杏奈", "フッ…聞いて後悔するがいい！", 0, 0, 0, 1, 0, 1.4, 2, "人呼んで「疾風の冥姫」!!", "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 1009, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (1, 1, "姫宮 真歩", "マホマホ王国のプリンセス、\nまほ姫どす", 0, 0, 0, 1, 0, 1.5, 2, "ほんまおおきにやわ～♪", "うさぎさん、\n運命の王子はんに巡りあわせてくれて", 1010, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (1, 1, "衣之咲 璃乃", "衣之咲璃乃です！", 0, 0, 0, 1, 0, 1.4, 2, "ここで会ったが\n100年目～！", "生き別れたお兄ちゃんを探して\n三千世界！", 1011, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (1, 1, "柏崎 初音", "私はハツネ、\n結構強いんだよ。\nきらーん☆", 0, 0, 0, 1, 0, 1.4, 2, "…って、お願い！\n誰にも言わないでおいて～！", "ち、超能力って…\n何のことかな～？", 1012, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (1, 1, "美波 鈴奈", "ちょす！\n美波鈴奈だよ～♪", 0, 0, 0, 1, 0, 1.4, 2, "ヒデサイまぢ\nGF（グッドフィーリング）～♪", "一応カリスマ読モJKやってまっす！", 1016, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (1, 1, "喜屋武 香織", "はいたーい。\n喜屋武香織さー。", 0, 0, 0, 1, 0, 1.4, 2, "でも、沖縄もとってもいいとこさー", "東京は遊園地みたいなところさー", 1017, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (1, 1, "支倉 伊緒", "支倉伊緒です。", 0, 0, 0, 1, 0, 1.4, 2, "イオちゃんって呼んでね。", "先生って呼ばれるのは\nくすぐったいから", 1018, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (1, 1, "茜 ミミ", "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 0, 0, 0, 1, 0, 1.5, 2, "ミミをおいてかないでぇ～", "あ！/\お兄ちゃ～ん\nまってよ～", 1020, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (1, 1, "栗林 くるみ", "あ…あの…えっと…\n栗…林…くるみ…です……", 0, 0, 0, 1, 0, 1.5, 2, "ふぇぇぇぇぇん……", "あの……\nふぇ……", 1021, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (1, 1, "風宮 より", "風宮よりです。\nあああああ！", 0, 0, 0, 1, 0, 1.4, 2, "なんてありがとうございます！", "こんな私に貴重な時間を\n割いていただき、", 1022, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (1, 1, "北条 綾音", "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 0, 0, 0, 1, 0, 1.5, 2, "私こっち行きたいー\nね、早く早くー", "おにいちゃんどこいくの？\nえ？", 1023, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (1, 1, "天野 すずめ", "わっ…わっ…私、\n天野すずめといいます！", 0, 0, 0, 1, 0, 1.4, 2, "これて何か違う…\nあああすみません！", "ふ、不束者ですが\nどうぞ末永く…って、", 1025, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (1, 1, "倉石 恵理子", "……クスクス…私は\n…倉石恵理子……", 0, 0, 0, 1, 0, 1.4, 2, "離しませんわ………\n絶対に…!!", "あなたは…運命の……\n伴侶……", 1027, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (1, 1, "佐々木 咲恋", "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 0, 0, 0, 1, 0, 1.4, 2, "…そうでしょ？？", "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", 1028, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (1, 1, "桜井 望", "桜井望だよ！\nよろしくねっ", 0, 0, 0, 1, 0, 1.4, 2, "あはは、\n私もまだまだだなぁ～", "ぇっと…\nキミ、私のこと知らないの?!", 1029, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (1, 1, "ニノン・ジュベール", "デケデケデンっ！", 0, 0, 0, 1, 0, 1.4, 2, "ショーグン、\nワタシと一緒に天下統一デース！", "初めまして、\n私はニノン・ジュベール申すデス！", 1030, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (1, 1, "上喜 しのぶ", "上喜しのぶです。\n手元のドクロが父です。", 0, 0, 0, 1, 0, 1.4, 2, "おかしいですね……", "でもって私の隣にいるのが……\nえ、見えない？", 1031, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (1, 1, "野戸まひる", "目指すはビッグな\nお笑い芸人だっぺ！", 0, 0, 0, 1, 0, 1.5, 2, "そう、\nオラのボケに突っ込める相方が…！", "けんども\nそれには足りないモンが…", 1033, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (1, 1, "綾瀬 ゆかり", "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 0, 0, 0, 1, 0, 1.4, 2, "ちょ\nちょっと一杯飲んできます…！", "ちょっと緊張しちゃって…", 1034, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (1, 1, "氷川 鏡華", "氷川鏡華…です", 0, 0, 0, 1, 0, 1.5, 2, "これ以上お話しすることは…\nないです！", "知らない人とは話しちゃいけないので", 1036, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (1, 1, "柏崎 栞", "柏崎…栞です。", 0, 0, 0, 1, 0, 1.4, 2, "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", "……あ、アラーム。", 1038, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (1, 1, "双葉 碧", "ふ、双葉碧です。", 0, 0, 0, 1, 0, 1.4, 2, "野に咲く花が、\n唯一の話相手です。", "私、一人も友達がいなくて……", 1040, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (1, 1, "三角 千歌", "三角千歌です。", 0, 0, 0, 1, 0, 1.4, 2, "そう思っています。", "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", 1042, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (1, 1, "安芸 真琴", "安芸真琴だ。", 0, 0, 0, 1, 0, 1.4, 2, "う、疑ってすまなかったな…", "あぁ？\nお前のそいつの仲間か？", 1043, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (1, 1, "イリヤ・オーンスタイン", "わらわこそは夜を総べる者！", 0, 0, 0, 1, 0, 1.4, 2, "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", "生けとし生ける全ての者よ！", 1044, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (1, 1, "遠見 空花", "そこで騎士は妖精を乱暴に……", 0, 0, 0, 1, 0, 1.4, 2, "ｌク、クウカに何かご用ですか!?", "ぐふふふふ……はっ！", 1045, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (1, 1, "宮坂たまき", "宮坂たまきにゃ♪\n猫はいいにゃよ？", 0, 0, 0, 1, 0, 1.4, 2, "う～ん…\n猫ってホントに最高にゃ～♪", "自由気ままで♪\n寝て遊んで、食べてケンカして…", 1046, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (1, 1, "大神 美冬", "大神美冬よ！", 0, 0, 0, 1, 0, 1.4, 2, "…と思ったら\nバイトの時間だ！\nまたあとでね！", "それでは早速クエストに…", 1048, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (1, 1, "星野静流", "星野静流だよ！", 0, 0, 0, 1, 0, 1.4, 2, "お姉ちゃんがぜ～んぶ\nやってあげるからね！", "クエストもバトルも\n掃除も洗濯も", 1049, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (1, 1, "玉泉美咲", "アタシは玉泉美咲。", 0, 0, 0, 1, 0, 1.5, 2, "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", "見ての通りの\nセクシー美少女で", 1050, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (1, 1, "リマ", "？？？", 0, 0, 0, 1, 0, 1.4, 2, "？？？？", "？？？？", 1052, 0);
